
function openAdvanced() {
    let flag = document.getElementById("open_advanced_flag");
    let x;
    if (flag.value === "off"){
        flag.value = "on";
        x = document.getElementById("enrichment_threshold_div");
        x.style.display = "block";
        if (document.getElementById("example_page").value === "no") {
            let input_is_provided_as_text = document.getElementById("input_is_provided_as_text");
            if (input_is_provided_as_text.checked === false) {
                // no enzyme
                x = document.getElementById("enzyme_div");
                x.style.display = "block";
            }
        } else {
                x = document.getElementById("enzyme_div");
                x.style.display = "block";
        }
    } else {
        flag.value = "off";
        // show enzyme
        x = document.getElementById("enzyme_div");
        x.style.display = "none";
        x = document.getElementById("enrichment_threshold_div");
        x.style.display = "none";
    }
}


function RawOrTxt() {
  let input_is_provided_as_text = document.getElementById("input_is_provided_as_text");
  // If the input_is_provided_as_text checkbox is unchecked, display the text input fields
  if (input_is_provided_as_text.checked){
    document.getElementById("msa_text_div").style.display = "block";
    document.getElementById("tree_text_div").style.display = "block";
    document.getElementById("msa_file_div").style.display = "none";
    document.getElementById("tree_file_div").style.display = "none";
    document.getElementById("enzyme_div").style.display = "none";
    document.getElementById("msa_file").value = '';
    document.getElementById("tree_text").value = '';
    //   if (document.getElementById("enrichment_threshold_div").style.display === "none"){
    // }
  } else {
      // show raw input
    document.getElementById("msa_text_div").style.display = "none";
    document.getElementById("tree_text_div").style.display = "none";
    document.getElementById("msa_file_div").style.display = "block";
    document.getElementById("tree_file_div").style.display = "block";
    if (document.getElementById("open_advanced_flag").value === "on") {
        document.getElementById("enzyme_div").style.display = "block";
        document.getElementById("enzyme").value = 'Trypsin';
    }
    document.getElementById("msa_text").value = '';
    document.getElementById("tree_text").value = '';
  }
}


function validate_input() {
    let input_is_provided_as_text = document.getElementById("input_is_provided_as_text");
    if (input_is_provided_as_text.checked){
        // text input
        if (!document.getElementById("msa_text").value){
            alert("Please provide an MSA...");
            return false;
        }
        if (!document.getElementById("tree_text").value){
            alert("Please provide a phylogenetic tree...");
            return false;
        }
    } else {
      // files input
        if (!document.getElementById("msa_file").value){
            alert("Please provide an MSA...");
            return false;
        }
        if (!document.getElementById("tree_file").value){
            alert("Please provide a phylogenetic tree...");
            return false;
        }
    }
    return true;
}


